import React from 'react';
import { BrowserRouter as Router, Route, Link, Outlet, Route as MyRoute, Routes } from 'react-router-dom';
import Home from './components/Home';
import './App.css';
import { ThemeProvider, createTheme } from '@mui/material/styles';

const theme = createTheme(); // You can customize the theme object here if needed

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div className="App">
          <Routes>
            <MyRoute exact path="/" element={<Home />} />
            {/* Add other routes here */}
          </Routes>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
